import React from 'react'
import { MainButton } from '../../Ui/Buttons/MainButton'

export const Main = () => {
  return (
    <div className='mainPageInformation'>
        <h2>Encuentra tu camino hacia una <font color=''>vida saludable y en forma: </font></h2>
        <p>decubre gimnasios cercanos, rutinas personalizadas y una amplia seleccion de producttos fitness para llevar tu estilo de vida activo al siguiente nivel</p>
        <MainButton/>
    </div>
  )
}
